import Header from "./components/Header";
import PxGroteskBold from "./fonts/PxGroteskBold.ttf";
import Sectra from "./fonts/Sectra.ttf";

const Index = () => (
  <div>
    <div>Hello</div>
    <Header />

    <style jsx global>{`
      @font-face {
        font-family: "Sectra";

        src: url('${Sectra}') format('truetype'),
      }
      * {
        font-family: "Sectra";
      }
    `}</style>
  </div>
);

export default Index;
